import React from 'react';
import '../Basic/sty'

function Resturant() {
  return (
    <>
      <div className="card-container">
        <div className="card">
          <div className="card-body">
            <span className="card-no card-circle-subtile">1</span>
          </div>
        </div>
      </div>
    </>
  )
}

export default Resturant
